import React from 'react'
import { NavLink } from 'react-router-dom'
const LinkButton = ({ path, text, type }) => {
  return (
    <NavLink className={`link-btn ${type}-btn`} to={path}>{text}</NavLink>
  )
}

export default LinkButton
